function writeStreamImageBase64(filepath,imgData,cb){
    var base64Data =imgData.toString().replace(/^data:image\/\w+;base64,/, "");
    var dataBuffer = new Buffer(base64Data, 'base64');
    var writeStream = fs.createWriteStream(filepath.toString());
    writeStream.write(dataBuffer);
    writeStream.on('drain', function() {
        cb(null);
    });
}

